import styled from "styled-components";
import photoPlaceHolder from "../images/photoPlaceHolder.webp";

const Card = styled.div`
  background-color: var(--dark-blue);
  display: flex;
  width: 90%;
  height: 120px;
  box-sizing: border-box;
`;

const Div = styled.div`
  margin: 10px 20px;
  padding: 0;
  color: var(--white);
`;

const Photo = styled.img`
  height: 120px;
`;

const Name = styled.h1`
  font-size: 18px;
  margin: 0;
`;

const Info = styled.p`
  font-size: 15px;
  margin: 5px 0;
  padding: 0;
`;
function SearchCard({ player }) {
  return (
    <Card>
      <Photo src={photoPlaceHolder}></Photo>
      <Div>
        <Name>{player.first_name + " " + player.last_name}</Name>
        <Info>{"Level: " + player.level}</Info>
        <Info>{"Primary: " + player.primary_position}</Info>
        <Info>{"Secondary Positions: " + player.secondary_position}</Info>
      </Div>
    </Card>
  );
}

export default SearchCard;

